import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 3.2-5508 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-5508.md","filePath":"vacode/3.2-5508.md"}'),r={name:"vacode/3.2-5508.md"},s=o('<h1 id="§-3-2-5508-definitions" tabindex="-1">§ 3.2-5508 Definitions. <a class="header-anchor" href="#§-3-2-5508-definitions" aria-label="Permalink to &quot;§ 3.2-5508 Definitions.&quot;">​</a></h1><p>As used in this chapter unless the context requires a different meaning:</p><p>&quot;Food establishment&quot; means those operations subject to regulation by the Virginia Department of Health as food establishments under the authority granted by § <a href="http://law.lis.virginia.gov/vacode/35.1-14/" target="_blank" rel="noreferrer">35.1-14</a>.</p><p>&quot;Registrant&quot; means any person who has registered with the Department as a transporter of waste kitchen grease.</p><p>&quot;Renderer&quot; means any person who commercially cooks carcasses, or parts or products of carcasses, of cattle, swine, poultry, and other animals and other waste animal by-products and waste kitchen grease into usable products.</p><p>&quot;Transport&quot; or &quot;transportation&quot; means the movement of waste kitchen grease in a motor vehicle on public roads.</p><p>&quot;Trap grease&quot; means waste kitchen grease that is removed from a grease trap and is principally derived from food preparation and processing.</p><p>&quot;Usable products&quot; means a product resulting from the processing of waste kitchen grease and shall include biofuels, lubricants, and animal feed, provided that such animal feed uses are allowed by the U.S. Food and Drug Administration.</p><p>&quot;Waste kitchen grease&quot; means animal fats or vegetable oils that have been used, and will not be reused, for cooking in a food establishment, including trap grease.</p><p>2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0868" target="_blank" rel="noreferrer">868</a>.</p>',10),n=[s];function i(d,c,p,l,h,u){return t(),a("div",null,n)}const g=e(r,[["render",i]]);export{m as __pageData,g as default};
